import React from "react";
import '../styles/Intro.css';
import Header from './Header';
import backgroundImage from '../images/intro-background.jpg';

function Intro() {
  return (
    <div className="intro">
      <Header />
      <div className="intro-photo"></div>
      <div className="intro-body">
        <div className="shop-mens intro-link">Shop Mens</div>
        <div className="shop-womens intro-link">Shop Womens</div>
      </div>
    </div>
  )
}

export default Intro;
